import React from 'react'
// import {Routes , Route} from 'react-router-dom'
/// the goal here is to output a list of users
/// now to pass it here we hv to import it here
import UsersList from '../Components/UsersList'
////// in this function we want to create a dummy users info but laster on we will integrate a backend for it


const User = () => {

  /// the dummy info USERS is an array of objects that represents each user
  const USERS =[
    {
      id: 'u1', 
      name: 'Max Schwarz' ,
      image: 
       'https://www.google.com/url?sa=i&url=https%3A%2F%2Fgh.linkedin.com%2Fin%2Framadan-yakubu-5493b61b0&psig=AOvVaw3RaPB0DYiuDQiNc9-x6_dH&ust=1709289897910000&source=images&cd=vfe&opi=89978449&ved=0CBMQjRxqFwoTCPiKh6yv0IQDFQAAAAAdAAAAABAE', 
      places: 3,
    }
  ]

  return (
    ///// we then extract the items prop inside this component
    <UsersList items={USERS}/>
  )
}

export default User
